import React from "react";
import "./styles/main.css";

function Queue(props) {
  return (
    <aside className="queue">
      <p className="queue__title">NEXT VIDEO</p>
      <ul className="queue__list">
        {this.state.queue.map((video) => (
          <li key={props.queue.id} className="queue__video">
            <img
              className="queue__video--thumb"
              src={props.queue.image}
              alt="thumb"
            />
            <div className="queue__text">
              <p className="queue__text--title">{props.queue.title}</p>
              <span className="queue__text--channel">
                {props.queue.channel}
              </span>
            </div>
          </li>
        ))}
      </ul>
    </aside>
  );
}

export default Queue;
